import React from "react";
import styled from "styled-components";

const TodoInsertModal = () => {
  return (
    <TodoInsertWrapper>
      <TodoInsertTitle placeholder="할 일" />
      <TodoInsertBody placeholder="상세 내용" />
      <TodoInsertButton />
    </TodoInsertWrapper>
  );
};

export default TodoInsertModal;

const TodoInsertWrapper = styled.div`
  width: 900px;
  height: 900px;
  margin-left: auto;
  margin-right: auto;
  margin-top: auto;
  background-color: rgba(0, 0, 0, 0.3);
`;

const TodoInsertTitle = styled.input`
  height: 100px;
`;

const TodoInsertBody = styled.textarea`
  height: 700px;
`;

const TodoInsertButton = styled.button`
  height: 100px;
`;
